  "terms_and_conditions": {
    "title": "Terms and conditions",
    "sub_title": "Legal information and noties",
    "term_1": {
      "title": "1. General recommendations.",
      "paragraph_1": "- Put yourself in your customer's shoes. Ask yourself if the message you are sending is something you would want to receive in your own inbox. If the answer is anything less than an enthusiastic \"yes!\" then you probably shouldn't send it.",
      "paragraph_2": "- Some industries have a reputation for poor quality or even malicious email practices. If you are  involved in the following industries, you must monitor your reputation very closely and resolve issues immediately:",
      "child_paragraph_1": "Home mortgage",
      "child_paragraph_2": "Credit",
      "child_paragraph_3": "Pharmaceuticals and supplements",
      "child_paragraph_4": "Alcohol and tobacco",
      "child_paragraph_5": "Adult entertainment",
      "child_paragraph_6": "Casinos and gambling",
      "child_paragraph_7": "Work-from-home programs"
    },
    "term_2": {
      "title": "2. Domain and \"From\" address considerations.",
      "paragraph_1": "- Think carefully about the addresses you send email from. The \"From\" address is one of the first pieces of information your recipients see, and therefore can leave a lasting first impression. Additionally, some ISPs associate your reputation with your \"From\" address.",
      "paragraph_2": "- Consider using subdomains for different types of communications. For example, assume you are sending email from the domain <i>example.com</i>, and you plan to send both marketing and transactional messages. Rather than sending all of your messages from <i>example.com</i>, send your marketing messages from asubdomain such as <i>marketing.example.com</i>, and your transactional messages from a subdomain such as <i>orders.example.com</i>. Unique subdomains develop their own reputations. Using subdomains reduces the risk of damage to your reputation if, for example, your marketing communications land in a spam trap or trigger a content filter.",
      "paragraph_3": "- If you plan to send a large number of messages, don't send those messages from an ISP-based address such as <i>sender@hotmail.com</i>. If an ISP notices a large volume of messages coming from <i>sender@hotmail.com</i>, that email is treated differently than an email that comes from an outbound email sending domain that you own.",
      "paragraph_4": "- Work with your domain registrar to ensure that the WHOIS information for your domain is accurate. Maintaining an honest and up-to-date WHOIS record demonstrates that you value transparency, and allows users to quickly identify whether or not your domain is legitimate.",
      "paragraph_5": "- Avoid using a <i>no-reply</i> address, such as <i>no-reply@example.com</i>, as your \"From\" or \"Reply-to\" address. Using a <i>no-reply@</i> email address sends your recipients a clear message: that you aren't offering them a way to contact you, and that you're not interested in their feedback."
    },
    "term_3": {
      "title": "3. Compliance.",
      "paragraph_1": "- Be aware of the email marketing and anti-spam laws and regulations in the countries and regions you send email to. You're responsible for ensuring that the email you send complies with these laws. This guide doesn't cover these laws, so it's important that you research them. For a list of laws, see <1>Email Spam Legislation</1> by Country on Wikipedia.",
      "paragraph_2": "- Always consult an attorney to obtain legal advice."
    }
  },
