    "faqs": {
      "faq_1": {
        "label": "Do I have to enter my credit card details to sign up?",
        "content": "No. We only need your email address and the name of your organization, and then you will be able to start creating campaigns."
      },
      "faq_2": {
        "label": "Do I need any prior knowledge or skills?",
        "content": "Not at all! {{siteName}} is designed with simplicity in mind, so we have the tools you need to easily build beautiful emails, create lists and set advanced preferences. If you ever need guidance, you can take a look at our many tutorials and resources, or contact our support team."
      },
      "faq_3": {
        "label": "Are there any contracts?",
        "content": "There are no contracts or hidden fees with {{siteName}}. You may change plans or cancel at any time. Sign up for a plan or purchase credits as you need them; there are no additional charges."
      },
      "faq_4": {
        "label": "Why choose a pay-as-you-go plan?",
        "content": "A pay-as-you-go plan is ideal for businesses and organizations that don't send emails often, or that don’t have a large contact list. PAYG credits do not expire, so you can use them at your own pace. One email sent equals one credit deducted. You still get all of our great features and services, however they do not include phone support. It is still possible to easily buy more credits or shift to a monthly plan at anytime though."
      },
      "faq_5": {
        "label": "Can I use my monthly plan for transactional email only?",
        "content": "Yes, you can! To help new transactional (SMTP) senders build a positive reputation over time, we apply an hourly sending bandwidth for accounts using our shared IPs. You'll start with the capacity to send 40 emails per hour, and your bandwidth will be adjusted automatically based on your engagement metrics. (Bandwidth limits do not affect senders using a dedicated IP.)"
      },
      "faq_6": {
        "label": "Can I try {{siteName}} before purchasing a plan?",
        "content": "Absolutely! When you create an account, you will automatically have a Free plan to upload unlimited contacts. Once we approve your account for sending, you can start sending up to 300 emails per day!"
      },
      "faq_7": {
        "label": "What if I change my mind?",
        "content": "If you change your mind, you can cancel your plan at any time directly from your account. Your data will be stored if you wish to use our services again, or we can delete all of your records upon your request."
      },
      "faq_8": {
        "label": "How can I pay?",
        "content": "All payments are made by credit card, through our secure payment processor, Adyen, or by Paypal. If you subscribe to a monthly plan, the subscription period is 30 days and charges are processed at the beginning of each period. Email and SMS credits are charged at purchase. All statements are available within your account."
      },
      "faq_9": {
        "label": "What is a dedicated IP?",
        "content": "A dedicated IP plan allows you to send email campaigns using your domain name and your own signature. You create transparency with your customers and build a reputation based on your IP and your domain name."
      },
      "faq_10": {
        "label": "Still have questions?",
        "content": "Contact us at {{contactEmail}} and we would be happy to answer any additional questions you may have."
      }
    },
